// ==/UserScript==

start();

function start(){
    try{
        addRefreshButton();

    }catch(err){
        setTimeout(() => start(), 100);
    }
}

var timeStatus = 0;
var alert = new Audio('data:audio/mp3;base64,');
alert.volume = getCookie('volume');
var newAlert = new Audio('data:audio/mp3;base64,');
newAlert.volume = getCookie('volume');

function addRefreshButton(){
    var menuList = document.getElementsByClassName('header-container right')[0];
    var clearButton = document.createElement('BUTTON');
    clearButton.innerHTML = 'Clear Export OFF';
    clearButton.id = 'clearBtn';
    clearButton.className = 'btn btn-tn btn-success';
    clearButton.onclick = function(event) {
        if (event.target.id === 'clearBtn') {
            checkStatus(clearButton);
        }
    }
    clearButton.onmousedown = function(event) {
        if (event.which == 3) {
            var filterSett = prompt("Filter:", getCookie('filter'));
            if (filterSett == null || filterSett == "") {

            } else {
                setCookie('filter', filterSett);
            }
        }
    }
    menuList.appendChild(clearButton);

    var soundButton = document.createElement('BUTTON');
    soundButton.innerHTML = 'Export Sound OFF';
    soundButton.id = 'soundBtn';
    soundButton.className = 'btn btn-tn btn-success';
    soundButton.onclick = function(event) {
        if (event.target.id === 'soundBtn') {
            checkTime(soundButton);

        }
    }
    soundButton.onmousedown = function(event) {
        if (event.which == 3) {
            var soundSett = prompt("Lautstrke (0 - 1):", getCookie('volume'));
            if (soundSett == null || soundSett == "") {

            } else {
                setCookie('volume', soundSett);
                location.reload();

            }
        }
    }
    menuList.appendChild(soundButton);
    var botButton = document.createElement('BUTTON');
    if(getCookie('bot') == 'ON'){
       botButton.innerHTML = 'Export Bot ON';
    }else{
       botButton.innerHTML = 'Export Bot OFF';
    }
    botButton.id = 'botButton';
    botButton.className = 'btn btn-tn btn-success';
    botButton.onclick = function(event) {
        if (event.target.id === 'botButton') {
            checkBot(botButton);
        }
    }
    menuList.appendChild(botButton);
}

function businessSelect(){
    document.getElementsByClassName('btn btn-default btn-secondary form-control ui-select-toggle')[0].click();
    document.getElementsByClassName('ui-select-choices dropdown-menu')[0].childNodes[3].childNodes[1].click()
}

var clearTime;
function checkStatus(clearButton){
    if(clearButton.innerHTML.includes('OFF')){
        clearButton.innerHTML = 'Clear Export ON';
        clearIt();
        clearTime = setInterval(() => clearIt(), 1000);
    }else{
        clearButton.innerHTML = 'Clear Export OFF';
        clearInterval(clearTime);
        var assignments = document.getElementsByClassName('assignment');
        for (let assignment of assignments) {
            assignment.style.removeProperty('display');
        }
    }
}


function checkTime(soundButton){
    if(soundButton.innerHTML.includes('OFF')){
        timeStatus = 1;
        soundButton.innerHTML = 'Export Sound ON';        
    }else{
        timeStatus = 0;
        soundButton.innerHTML = 'Export Sound OFF';
        alert.pause();
        newAlert.pause();
    }
}

function checkBot(botButton){
    if(botButton.innerHTML.includes('OFF')){
        botButton.innerHTML = 'Export Bot ON';
        setCookie('bot','ON');
    }else{
        botButton.innerHTML = 'Export Bot OFF';
        setCookie('bot','OFF');
    }
}


function clearIt(){
    if(window.location.href.includes('export')){
        var assignments = document.getElementsByClassName('assignment');
        var nots = [];
        var filters = StringToArray(getCookie('filter'));
        for (let assignment of assignments) {
            assignment.style.display = 'none';
        }
        for (let assignment of assignments) {
            for (let filter of filters){
                if(assignment.innerHTML.includes(filter)){
                    nots.push(assignment);
                }
            }
        }
        var count = 0;
        while(count < nots.length){
            nots[count].style.removeProperty('display');
            count++;
        }
    }
}

setInterval(() => alertCheck(), 11000);
function alertCheck(){
    
    if(document.getElementById('soundBtn').innerHTML.includes('ON')){
        var assignments = document.getElementsByClassName('assignment');
        var filters = StringToArray(getCookie('filter'));
        for (let assignment of assignments) {
            for (let filter of filters){
                var time = assignment.children[0].children[1].children[6].children[1].children[0].innerHTML;
                var timeTrans = time.replace(':', '').replace(':', '');
                if(timeTrans < 200 && assignment.innerHTML.includes(filter)){

                    alert.play();

                }
            }
        }
    }
}

var lastAssignment = null;

setInterval(() => newSoundCheck(), 1000);
function newSoundCheck(){
    if(window.location.href.includes('export')){
        var newLastAssignment = document.getElementsByClassName('assignment')[19];
        var newLastAssignmentInner = newLastAssignment.children[0].children[0].innerHTML;
        var filters = StringToArray(getCookie('filter'));
        for (let filter of filters){
            if(lastAssignment != null && lastAssignment != newLastAssignmentInner && newLastAssignmentInner.includes(filter)){
                newAlert.play();
                if(botButton.innerHTML.includes('ON')){
                    var lastBid = newLastAssignment.childNodes[1].childNodes[3].childNodes[5].childNodes[3].innerHTML;
                    var value = lastBid.substring(lastBid.indexOf('$') + 1, lastBid.length - 2).replace(',','');
                    newLastAssignment.childNodes[1].childNodes[3].childNodes[15].childNodes[1].childNodes[1].value = Math.trunc((value - 0.01) * 10) / 10;
                    businessSelect();
                }
            }
        }
        lastAssignment = newLastAssignmentInner;
    }
}

function StringToArray(filterString){
    var filterArray =  filterString.split(',');
    return filterArray;
}

function setCookie(cname, cvalue) {
    var expires = "expires=Sat, 03 Jan 2037 11:39:08 GMT";
    document.cookie = cname + "=" + cvalue + ";" + expires + ";path=/";
}

function getCookie(cname) {
    var name = cname + "=";
    var decodedCookie = decodeURIComponent(document.cookie);
    var ca = decodedCookie.split(';');
    for(var i = 0; i <ca.length; i++) {
        var c = ca[i];
        while (c.charAt(0) == ' ') {
            c = c.substring(1);
        }
        if (c.indexOf(name) == 0) {
            return c.substring(name.length, c.length);
        }
    }
    return "";
}
